function NotebookTitle() {
   const onTextChange = e => {
        firebase.database().ref('notebooks/0').set({
          title: e.value,
        });
      }

    return (
        <div className="notebook-title" contentEditable="true" onChange={onTextChange}>Enter title...</div>
    );
}

export default NotebookTitle;
